import Form from "./form";
import ChatTab from "./chatTab";
import { Route, Router } from "react-router-dom";

function App() {
  return (
    <div>
      <Form></Form>
      <Router>
        <Route path="/chatTab" component={ChatTab}></Route>
      </Router>
      <ChatTab></ChatTab>
    </div>
  );
}

export default App;
